import React, { Component } from 'react'
import {Button, Form } from 'react-bootstrap'

export default class Submit extends Component {
    constructor(){
        super()
        this.state = {
            makeTodo: ""
        }
    }

    handleTodoChange = (event) => {
        this.setState({
            makeTodo: event.target.value
        })
    }
    render() {
        return (
            <div>
            <Form>
                <Form.Group>
                    <Form.Control type="text" placeholder="Enter Todo" value={this.state.makeTodo} />
                </Form.Group>
                <Button variant="primary" type="submit">Make Todo</Button>
            </Form>
        </div>
        )
    }
}
